$(function(){
	var torrent_img = "data:image/png;base64,";
	var magnet_img = "data:image/png;base64,";
	var get_torrent_img = $(".block");
	get_torrent_img.width(312);
	get_torrent_img.height(80);
	get_torrent_img.attr('src', torrent_img);
	function getQueryFrom(variable) {
		var query = window.location.search.substring(1);
		var vars = query.split('&');
		for(var i=0; i<vars.length; i++) {
			var pair = vars[i].split('=');
			if(pair[0] == variable) {
				return pair[1];
			}
		}
		return(false);
	}
	var id = getQueryFrom('id');
	$.get('/get_srv_details.php?id=' + id + '&action=2', function(s) {
		var result = new RegExp('Инфо хеш: (.\{40\})').exec(s);
		$("td[class='nw']").after('<td style="padding-left: 10px;width: 312px;height:80px;"class="nw2"><center><a href="magnet:?xt=urn:btih:' + result[1] + '"><img src="' + magnet_img + '"></a></center></td>');
	});
});